          "body": "<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n\t<meta charset=\"UTF-8\" />\n\t<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />\n\t<title>{{app_name}} - Tax Invoice</title>\n\t<style>\n\t\tbody {\n\t\t\tfont-family: 'Times New Roman', Times, serif;\n\t\t\ttext-align: center;\n\t\t\tcolor: #777;\n\t\t\tfont-size: 12px;\n\t\t}\n\n\t\ttable {\n\t\t\twidth: 100%;\n\t\t\tborder-collapse: collapse;\n\t\t}\n\n\t\tth, td {\n\t\t\tborder: 1px solid black;\n\t\t\tpadding: 8px;\n\t\t\ttext-align: left;\n\t\t}\n\n\t\tth {\n\t\t\tfont-weight: bold;\n\t\t}\n\t</style>\n</head>\n\n<body>\n\n<div id=\"print-content\" style=\"border: black 1px solid;\">\n\n\t<div style=\"border-bottom: 1px solid black; padding: 16px;\">\n\t\t<div style=\"display: flex; align-items: center;\">\n\t\t\t<div style=\"flex: 0 0 16.66%;\">\n\t\t\t\t<img src=\"{{pdf_app_logo}}\" alt=\"Logo\" height=\"90\" width=\"200\">\n\t\t\t</div>\n\t\t\t<div style=\"flex: 1; text-align: center;\">\n\t\t\t\t<h6 class=\"invoice-title\" style=\"font-weight: bold; color: blue; margin: 0; font-size: 20px !important; margin-bottom: 5px;\">\n\t\t\t\t\tOrder Confirmation\n\t\t\t\t</h6>\n\t\t\t\t<p style=\"margin: 0; font-size: 12px;\">\n\t\t\t\t\t{{company_address}}\n\t\t\t\t</p>\n\t\t\t\t<p style=\"margin: 0; font-size: 12px;\">\n\t\t\t\t\t<strong style=\"margin-right: 2px;\">MOB: </strong> {{company_phone}} <strong style=\"margin-right: 2px;\"> GSTIN NO: </strong> {{gst_number}}\n\t\t\t\t</p>\n\t\t\t</div>\n\t\t</div>\n\t</div>\n\n\t<div style=\"display: flex; justify-content: space-around; border-bottom: 1px solid; padding: 0 4px;\">\n\t\t<strong style=\"font-size: 15px;\">Order Confirmation</strong>\n\t\t<strong style=\"font-size: 15px;\">Shipping Address</strong>\n\t\t<strong style=\"font-size: 15px;\">Billing Address</strong>\n\t</div>\n\n\t<div style=\"padding: 0 2px;\">\n\t\t<div style=\"display: flex;\">\n\t\t\t<div style=\"flex: 1; border-right: 1px solid; padding: 4px;\">\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\"><strong>Order number #:</strong> {{order_number}}</p>\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\"><strong>Order Date:</strong> {{order_date}}</p>\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\"><strong>Created:</strong> {{invoice_date}}</p>\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\"><strong>Payment Method:</strong> {{payment_method}}</p>\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\"><strong>Transaction ID:</strong> {{transaction_id}}</p>\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\"><strong>HSN Code:</strong> 711319</p>\n\t\t\t</div>\n\n\t\t\t<div style=\"flex: 1; border-right: 1px solid; padding: 4px;\">\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\">{{shipping_address.house_builing}}</p>\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\">{{shipping_address.area_name}} {{billing_address.city}}, {{shipping_address.state}}</p>\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\">{{shipping_address.pincode}}, {{shipping_address.country}}</p>\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\">{{shipping_address.phone_number}}</p>\n\t\t\t</div>\n\n\t\t\t<div style=\"flex: 1; padding: 4px;\">\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\">{{billing_address.house_builing}}</p>\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\">{{billing_address.area_name}} {{billing_address.city}}, {{billing_address.state}}</p>\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\">{{billing_address.pincode}}, {{billing_address.country}}</p>\n\t\t\t\t<p style=\"font-size: 13px; margin: 0;\">{{billing_address.phone_number}}</p>\n\t\t\t</div>\n\t\t</div>\n\t</div>\n\n\t<div style=\"overflow-x: auto; padding: 0 4px;\">\n\t\t<table>\n\t\t\t<thead style=\"background-color: #f5f5f5;\">\n\t\t\t\t<tr>\n\t\t\t\t\t<th>Sr No</th>\n\t\t\t\t\t<th>Product Name</th>\n\t\t\t\t\t<th>Qty</th>\n\t\t\t\t\t<th>Purity</th>\n\t\t\t\t\t<th>Metal wt.</th>\n\t\t\t\t\t<th>Rate ({{currency}})</th>\n\t\t\t\t\t<th>Amount ({{currency}})</th>\n\t\t\t\t\t<th>Dia Amount ({{currency}})</th>\n\t\t\t\t\t<th>Making Charges ({{currency}})</th>\n\t\t\t\t\t<th>Other Charges ({{currency}})</th>\n\t\t\t\t\t<th>Total Amount ({{currency}})</th>\n\t\t\t\t</tr>\n\t\t\t</thead>\n\t\t\t<tbody>\n\t\t\t\t{{#product_new_data}}\n\t\t\t\t<tr>\n\t\t\t\t\t<td>{{index}}</td>\n\t\t\t\t\t<td>{{productTitle}} <br/> {{productSku}} ({{orderNumber}}) <br />{{metalTone}}</td>\n\t\t\t\t\t<td>{{quantity}}</td>\n\t\t\t\t\t<td>{{purity}}</td>\n\t\t\t\t\t<td>{{metalWeight}}</td>\n\t\t\t\t\t<td>{{rate}}</td>\n\t\t\t\t\t<td>{{amount}}</td>\n\t\t\t\t\t<td>{{diamondAmount}}</td>\n\t\t\t\t\t<td>{{makingCharges}}</td>\n\t\t\t\t\t<td>{{otherCharges}}</td>\n\t\t\t\t\t<td>{{totalAmount}}</td>\n\t\t\t\t</tr>\n\t\t\t\t{{/product_new_data}}\n\t\t\t\t<tr>\n\t\t\t\t\t<td colspan=\"8\"></td>\n\t\t\t\t\t<td colspan=\"3\">\n\t\t\t\t\t\t<div style=\"display: flex; justify-content: space-between;\">\n\t\t\t\t\t\t\t<span><strong>Sub Total :</strong></span>\n\t\t\t\t\t\t\t<span><strong>{{currency}}{{sub_total_amount}}</strong></span>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t\t<div style=\"display: flex; justify-content: space-between;\">\n\t\t\t\t\t\t\t<span><strong>Discount :</strong></span>\n\t\t\t\t\t\t\t<span><strong>{{currency}} {{coupon_discount}}</strong></span>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t\t{{#tax_array}}\n\t\t\t\t\t\t<div style=\"display: flex; justify-content: space-between;\">\n\t\t\t\t\t\t\t<span><strong>{{name}} ({{rate}})% :</strong></span>\n\t\t\t\t\t\t\t<span><strong>{{currency}}{{tax_amount}}</strong></span>\n\t\t\t\t\t\t</div>\n\t\t\t\t\t\t{{/tax_array}}\n\t\t\t\t\t\t<div style=\"display: flex; justify-content: space-between;\">\n\t\t\t\t\t\t\t<span><strong>Grand Total:</strong></span>\n\t\t\t\t\t\t\t<span><strong>{{currency}}{{total_amount}}</strong></span>\n\t\t\t\t\t</div>\n\t\t\t\t</td>\n\t\t\t\t</tr>\n\t\t\t</tbody>\n\t\t</table>\n\t</div>\n\n\t<div style=\"display: flex; flex-direction: column;\">\n\t\t<div style=\"display: flex; height: 80px;\">\n\t\t\t<div style=\"flex: 8; padding: 4px; font-size: 13px;\">\n\t\t\t\t<p><strong>Note :</strong></p>\n\t\t\t\t<p>We declare to the best of our knowledge and belief that the particulars stated herein are true and correct</p>\n\t\t\t\t<p>This is a Computerised generated invoice. If you have any query, please contact {{company_email}}</p>\n\t\t\t</div>\n\t\t</div>\n\t</div>\n</div>\n</body>\n</html>",
